import * as React from 'react';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import ImageListItemBar from '@mui/material/ImageListItemBar';

import axios from 'axios';

import image1 from "../imgs/zap1.png";
import image2 from "../imgs/zap2.jfif";
import image3 from "../imgs/zap3.jfif";
import image4 from "../imgs/Zap4.jfif";
import "../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../../node_modules/bootstrap-icons/font/bootstrap-icons.css";




function ListImg() {


  const handleClick = event => {
    let clicked =event.currentTarget.id
    console.log(event.currentTarget.id)
    let newModEst={
      modelo: "",
      marca: "",
      color: "",
      numero: 0
    }
    if(clicked=0){

      let newMod0= {
        modelo: "model08",
        marca: "adidas",
        color: "rojosss",
        numero: 21
      }
      newModEst=newMod0
    }
    if(clicked=1){
      let newMod1 = {
        modelo: "model09",
        marca: "Nikes",
        color: "azules",
        numero: 12
      }
      newModEst=newMod1
    }
    
    axios.post("http://localhost:5000/api/carrito",newModEst)
    .then((response)=>{
        console.log(response)
  
    })
    .catch((error)=>{
        console.log(error)
    })
  };
  let idd=0


  return (
    <ImageList sx={{ width: 500, height: 700 }}>
      
      {itemData.map((item) => (
        <ImageListItem key={item.img}>
          <img 
            
            src={`${item.img}?w=248&fit=crop&auto=format`}
            srcSet={`${item.img}?w=248&fit=crop&auto=format&dpr=2 2x`}
            alt={item.title}
            loading="lazy"
            
          />
          <ImageListItemBar
            title={item.title}
            subtitle={<span>by: {item.author}</span>}
            position="below"
            
          />
          
                    <button
            id={`${idd}`}
            className="btn btn-primary"
            onClick={handleClick}
           >
            Add To Car 
          </button>
          {idd++}
          
        </ImageListItem>
      ))}
    </ImageList>
  );
}
export default ListImg



const itemData = [
  {
    img: image1,
    title: 'Modelo1',
    author: 'CalvinKlein',
  },
  {
    img: image2,
    title: 'Modelo2',
    author: 'RY',
  },
  {
    img: image3,
    title: 'Modelo3',
    author: 'MK',
  },
  {
    img: image4,
    title: 'Modelo4',
    author: 'Flexy',
  }
];
